import React, { Component } from "react";
import "./loginnavbar.css";

function LoginNavbar(props) {
  return (
    <div>
      <div className="login-form-nav">
        <h2>NED University Of Engineering And Technology</h2>
      </div>
    </div>
  );
}

export default LoginNavbar;
